import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { useState, useEffect } from 'react';


function VerificationList() {
  const accpetHandler=(studID)=>{
    console.log(studID)
    fetch("http://localhost:5000/user/verify/accept", {
      method: "POST",
      crossDomain: true,
      headers: {
        "Access-Control-Allow-Origin": "*",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({studentID:studID})
    })
  }
  const rejectHandler=(studID)=>{
    fetch("http://localhost:5000/user/verify/reject", {
      method: "POST",
      crossDomain: true,
      headers: {
        "Access-Control-Allow-Origin": "*",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({studentID:studID})
    })
  }
  const [users, setusers] = useState([])
  useEffect(() => {
    getUsers();
  }, []);
  const getUsers = () => {
    let bs = {
      college: "1",
      status: 0
    };
    fetch("http://localhost:5000/user/verify", {
      method: "POST",
      crossDomain: true,
      headers: {
        "Access-Control-Allow-Origin": "*",
        "Content-Type": "application/json",
      },
      body: JSON.stringify(bs)
    })
      .then(res => res.json())
      .then(
        (users) => {
          setusers(users)
        },
        (error) => {
          alert(error);
        }
      );
  }
  console.log(users);
  return (
    <div className='container-fluid'>
      <div className='table-responsive' >
        <table className='table'>
          {users.map(user =>
            <tr key={user._id}>
              <td>
                <table className="table">
                  <tbody><tr>
                    <td >{user.firstname + user.lastname}</td>
                  </tr>
                    <tr>
                      <td>{user.graduationyear}</td>
                    </tr>
                    <tr>
                      <td>{user.studentID}</td>
                    </tr>
                  </tbody></table>
              </td>
              <td>
                <button>Click to open Document</button>
              </td>
              <td>
                <button onClick={accpetHandler(user.studentID)}>Accept</button>
              </td>
              <td>
                <button onClick={rejectHandler(user.studentID)}>Reject</button>
              </td>
            </tr>
          )
          }

        </table>

      </div >
    </div >
  );
};
